import React from 'react';
import './App.css';

export default class Menu2 extends React.Component {
  state = {
    friends: [
      {
        id: 1,
        icon:
          '<svg class="u-svg-link" preserveAspectRatio="xMidYMin slice" viewBox="0 0 60 60" style=""><use xlink:href="#svg-6a51"></use></svg>',
        name: 'For you and your family',
        text: 'We protect vehicles, property, pets and events.',
        more: 'read more',
      },
      {
        id: 2,
        icon: 'phone',
        name: 'For you and your family',
        text: 'We protect vehicles, property, pets and events.',
        more: 'read more',
      },
      {
        id: 3,
        icon: 'phone',
        name: 'For you and your family',
        text: 'We protect vehicles, property, pets and events.',
        more: 'read more',
      },
    ],
  };
  render() {
    return (
      <div className='menu2'>
        <h2>Insurance and investing for your many sides</h2>
        <h3>
          WE'VE BEEN PROTECTING PEOPLE, BUSINESSES AND FUTURES FOR MORE THAN 90
          YEARS.
        </h3>
        {this.state.friends.map((friend) => {
          return (
            <div key={friend.id}>
              <span>{friend.icon}</span>
            </div>
          );
        })}
      </div>
    );
  }
}
